import React from "react";
import Card from "./Card"
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">Meus Contatos</h1>
      <Card
        nome="Tyler Joseph"
        imagem="https://cdn.allfamous.org/people/avatars/tyler-joseph-x2jo-allfamous.org.jpg"
        telefone="+123 456 789"
        email="t@twentyonepilots.com"
      />
      <Card
        nome="Josh Dun"
        imagem="https://i.pinimg.com/originals/ce/06/d5/ce06d5e40f4bd76b4f7c279ebd642cc9.jpg"
        telefone="+123 456 789"
        email="j@twentyonepilots.com"
      />
      <Card
        nome="Dave Bayley"
        imagem="https://pbs.twimg.com/profile_images/1251657274478788608/b75AlKK-.jpg"
        telefone="+123 456 789"
        email="d@glassanimals.com"
      />
      <Card
        nome={contacts[0].name}
        imagem={contacts[0].imgURL}
        telefone={contacts[0].phone}
        email={contacts[0].email}
      />
      Card
        nome={contacts[1].name}
        imagem={contacts[1].imgURL}
        telefone={contacts[1].phone}
        email={contacts[1].email}
      />
      Card
        nome={contacts[2].name}
        imagem={contacts[2].imgURL}
        telefone={contacts[2].phone}
        email={contacts[2].email}
      />
    </div>
  );
}

export default App;
